sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var inputsPayload = {};

// requested_item is a input of type: glide_record
inputsPayload = {
	service_description: inputs.programDesc
};

var request = {
	executionRequests: [{
		payload: inputsPayload,
		capabilityId: '0e08981bfb8c6e10625bf7704eefdc4a',
		meta: {
			skillConfigId: '2a08905bfb8c6e10625bf7704eefdc64'
		}
	}], 
	mode: 'sync' 
};

try {
	gs.addInfoMessage(JSON.stringify(sn_one_extend.OneExtendUtil.execute(request)));
	outputs.prompt_output = sn_one_extend.OneExtendUtil.execute(request)['capabilities'][request.executionRequests[0].capabilityId]['response'];
} catch(e) {
	gs.error(e);
	gs.addErrorMessage('Something went wrong while executing skill.');
}
//action.setRedirectURL(current);


})(inputs, outputs);

